    //detect a # symbol in the url part. Only use the part before the #\n    if(vars[j].indexOf('#')>-1){\n      vars[j] = vars[j].split('#')[0];\n    }\n  }\n  //vars.concat(additional);\n  var query_string = {};\n  \n  //create kay/value pairs\n  for(var i=0; i<vars.length; i++) {\n    var pair = vars[i].split(\"=\");\n    var key = decodeURIComponent(pair[0]);\n    var value = decodeURIComponent(pair[1]);\n    //if(value.indexOf('#'))\n    // If first entry with this name\n    if (typeof query_string[key] === \"undefined\") {\n      query_string[key] = decodeURIComponent(value);\n      // If second entry with this name\n    } else if (typeof query_string[key] === \"string\") {\n      var arr = [query_string[key], decodeURIComponent(value)];\n      query_string[key] = arr;\n      // If third or later entry with this name\n    } else {\n      query_string[key].push(decodeURIComponent(value));\n    }\n  }\n  return query_string;\n}\n\nfunction delete_cookie(cookieName) {\n  var fullCookieName = _satellite.getVar('Tech: Short Tenant ID') +'_c_' +cookieName;\n  if(_satellite.cookie.get(fullCookieName)){\n    _satellite.logger.log('Deleting cookie ' +fullCookieName);\n    _satellite.cookie.remove(fullCookieName); \n  }\n}\n\n//helper function\n/* to use it:\nwaitForElm('.some-class').then((elm) => {\n    console.log('Element is ready');\n    console.log(elm.textContent);\n});\n*/\nfunction waitForElm(selector) {\n    return new Promise(resolve => {\n        if (document.querySelector(selector)) {\n            return resolve(document.querySelector(selector));\n        }\n\n        const observer = new MutationObserver(mutations => {\n            if (document.querySelector(selector)) {\n                resolve(document.querySelector(selector));\n                observer.disconnect();\n            }\n        });\n\n        observer.observe(document.body, {\n            childList: true,\n            subtree: true\n        });\n    });\n}",language:"javascript"}}]},{id:"RLa